import { Component } from '@angular/core';
import { SignUp } from './sign-up';

@Component({
  selector: 'app-root',
  templateUrl: './app.component.html',
  styleUrls: ['./app.component.css']
})
export class AppComponent {
  title = 'BreadBasket';
  isAddUser = false;

  addUser(user: SignUp) {
    this.isAddUser = false;
  }

  addNewUser(user: SignUp ){
    this.isAddUser = true;

  }
}
<body>
  <header>
    <div class="topnav">
      <ul>
      <img class="logo-img" href="BreadBasket" src="../assets/Images/logonamu.png"  width="130" height="130" ALIGN=CENTER>
      <a routerLink="/sign-in-component">Sign In</a>
      <a routerLink="/sign-up-component">Sign Up</a>
      <a routerLink="/with-fillings-component">With Fillings Bread</a>
      <a routerLink="/no-fillings-component">No Fillings Bread</a>
      <a class="active" routerLink="/home-component">Home</a>
    </ul>
    </div>
    </header>
</body>
